def pong_ai(paddle_frect, other_paddle_frect, ball_frect, table_size):
    #The main body of the AI
    global ball_pos_history
    global predicted_pos
    global state

    #check states
    check_side(paddle_frect)

    #store nessacerry info
    store_frame_info_more_frames(paddle_frect, other_paddle_frect, ball_frect, 5, table_size)

    global side
    if side == "left":
        ball_pos_history.append(ball_frect.pos)
    elif side == "right":
        posi = (table_size[0] - ball_frect.pos[0],ball_frect.pos[1])
        ball_pos_history.append(ball_frect.pos)


    if if_flip(ball_pos_history):

        check_state(paddle_frect, other_paddle_frect, ball_frect)

        v = get_velocity(ball_pos_history[-2], ball_pos_history[-1])
        # update predicted_pos only when opponent hits the ball
        if (((v[0] < 0) and (paddle_frect.pos[0] < table_size[0]/2)) or ((v[0]>0) and (paddle_frect.pos[0]>table_size[0]/2))):
            predicted_pos = predict_position(ball_pos_history[-2], ball_pos_history[-1], table_size, ball_pos_history[-3][1])

    check_win(paddle_frect, other_paddle_frect, ball_frect)

    #update according to states
    if state == "chaser_mode" or state == "new_game":
        # do one round of training
        update(True)
        return chaser(paddle_frect, other_paddle_frect, ball_frect, table_size)

    #use chaser if y velocity is too high:
    vy = abs(get_velocity(ball_pos_history[-2], ball_pos_history[-1])[1])

    return controller(predicted_pos, paddle_frect.pos[1], paddle_frect, other_paddle_frect, ball_frect, table_size, vy)

def controller(desired_pos, current_pos, paddle_frect, other_paddle_frect, ball_frect, table_size, vy):
    #controls the bot --- under prediction mode
    threshold = 9
    if vy < threshold:
        if 35 > abs(desired_pos-35 - current_pos):
            ret = get_ret()
            update()
            return ret
        else:
            update()
            if current_pos < desired_pos-35:
                return "down"
            else:
                return "up"
    else:
        update()
        if 30 > abs(desired_pos-35 - current_pos):
            return chaser(paddle_frect, other_paddle_frect, ball_frect, table_size)
        else:
            if current_pos < desired_pos-35:
                return "down"
            else:
                return "up"

def chaser(paddle_frect, other_paddle_frect, ball_frect, table_size):
    #controls the bot --- under chaser mode
    if paddle_frect.pos[1]+paddle_frect.size[1]/2 < ball_frect.pos[1]+ball_frect.size[1]/2:
     return "down"
    else:
     return "up"

